import React from "react";
import "./maketai.css";

function Maketai() {
    return (
        <div className="maketai-container">
            {/* Cover Section */}
            <div className="section cover">
                <h1>PORTFOLIO</h1>
            </div>

            {/* Fotografijos Section */}
            <div className="section">
                <div className="photo-row">
                    <img src="photo1.jpg" alt="" />
                    <img src="photo2.jpg" alt="" />
                    <img src="photo3.jpg" alt="" />
                </div>
            </div>

            {/* Foto Manipuliacija Section */}
            <div className="section">
                <div className="photo-row">
                    <img src="manipulation1.jpg" alt="" />
                    <img src="manipulation2.jpg" alt="" />
                    <img src="manipulation3.jpg" alt="" />
                </div>
            </div>

            {/* Plakatai Section */}
            <div className="section">
                <div className="photo-row">
                    <img src="poster1.jpg" alt="" />
                    <img src="poster2.jpg" alt="" />
                    <img src="poster3.jpg" alt="" />
                </div>
            </div>

            {/* Illustration Section */}
            <div className="section">
                <img className="full-width-image" src="illustration.jpg" alt="" />
            </div>
        </div>
    );
}

export default Maketai;
